import React, { Component } from "react";
import "../../styles/content.scss";
export default class Content extends Component {
  getCharacter = () => {
   
  };
  componentDidMount() {
    this.getCharacter();
  }

  handleSubmit = () => {
    let url = this.props.url;
    url = this.props.info.next;
    this.props.characters(url);
  };
  render() {
    return (
      <div class="part-content">
        <h1>Characters</h1>
        <div class="content mt-5">{}</div>





        <div class="navigation">
          <nav aria-label="Page navigation example">
            <ul class="pagination">
              <li class="page-item">
                <a class="page-link" href={this.props.info.prev}>
                  prev
                </a>
              </li>
              <li class="page-item">
                <a class="page-link" href="/">
                  1
                </a>
              </li>
              <li class="page-item">
                <a class="page-link" href="/">
                  1
                </a>
              </li>
              <li class="page-item">
                <a class="page-link" href="/" onClick={this.handleSubmit}>
                  Next
                </a>
              </li>
            </ul>
          </nav>
        </div>
      </div>
    );
  }
}
